# Differential coverage index for CPython 3.12+ parity.
# Lane rules:
# - core PEP/language + builtins coverage lives under tests/differential/basic
# - stdlib module/submodule coverage lives under tests/differential/stdlib
# - Molt-specific APIs belong under tests/differential/moltlib (if present)
